import React, { Component } from "react";
import { Link } from "react-router-dom";
import Like from "./like";

class AdviseeTableBody extends Component {
  render() {
    const { advisees } = this.props; //this.props.people
    return (
      <tbody>
        {advisees.map((advisee, index) => (
          <tr key={index}>
            <td>{advisee.lName}</td>
            <td>{advisee.fName}</td>
            <td>{advisee.email}</td>
            <td>
              <Link to={`emailto:${advisee.studentID}`}>
                {" "}
                {advisee.studentID}{" "}
              </Link>
            </td>
            <td>
              <Link to={`/student/${advisee.studentID}`}>
                {" "}
                {advisee.studentID}{" "}
              </Link>
            </td>
          </tr>
        ))}
      </tbody>
    );
  }
}

export default AdviseeTableBody;
